import React from "react";
import "../Styles/RightMenu.css";
import { FaCrown } from "react-icons/fa";

function RightMenu() {
  return (
    <div className="rightMenu">
      <div className="goPro">
        <i>
          <FaCrown />
          <p>
            {" "}
            Go <span>Pro</span>
          </p>
        </i>
      </div>
      <div className="Profile"></div>
    </div>
  );
}

export { RightMenu };
